css:
@namespace url(http://www.w3.org/1999/xhtml);



@-moz-document url-prefix('http://www.tumblr.com/'), url-prefix('https://www.tumblr.com/')   {



#logo {

height: 0 !important;

width: 0 !important;

/* these numbers match the new image's dimensions */

padding-left: 230px !important;

padding-top: 64px !important;

background: url('http://i55.tinypic.com/a2zluc.jpg') no-repeat !important;

font-family:Courier New !important;

font-size:11px !important;

}



ol#posts li.post.new_post {background: #ffffff url('http://i55.tinypic.com/v8odv7.jpg') center center no-repeat;}



img[src*="http://assets.tumblr.com/images/new_post_icons_no_labels.png"]{width:0;height:40px;padding-right:250px;opacity: 0;}



.new_post_label{font-size:16px !important;padding-top:1px !important;font-family:Arial, !important;font-style: !important;text-transform: lowercase !important;color:#000 !important;letter-spacing:1px !important}
}
